import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import styled from "styled-components";

function Contact() {
  return (
    <Container>
      <Header />
      <Footer />
    </Container>
  );
}

export default Contact;

const Container = styled.div`
  height: 100vh;
`;
